contracts/30Hello.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity >= 0.7.0 < 0.9.0;
import "forge-std/console.sol";

contract Example{
    enum Choice {Up, Down, Left, Right}

    constructor(Choice choice){
        if(choice == Choice.Up){
            console.log("Up");
        }
        if(choice == Choice.Down){
            console.log("Down");
        }
    }
}

